                <li> <NavLink className="apply-visa"> Apply For Visa </NavLink> </li>
                <li> <NavLink className="nav-bar"> Home </NavLink> </li>
                

               
              
                
                <NavLink className="nav-bar"> Contact Us </NavLink>
            </ul>
        </div>
    )
}
export default Nav
